int nnResource::Get(const char *file,const unsigned char ** ptr,size_t *size)
{
    int res=-1;
    std::string s=file;
    std::map<std::string,memresource >::iterator it=appResource.find(s);
    if( it!=appResource.end())
    {
        *ptr=it->second.resource;
        *size=it->second.size;
        res=0;
    }
    return res;
}



